import styled from "styled-components";
import '../App.css';

const PersonalArea = styled.div`
  width: 300px;
  height: 50px;
  border-color: blueviolet;
`

const Header = () => {
  return (
    <div>
      <PersonalArea>
        net
      </PersonalArea>
    </div>
  );
}

export default Header;
